import React, { Component } from 'react';
import {ProductConsumer} from '../context';


export default class Details extends Component {
    render() {
        return (
            <ProductConsumer>
                {value=> {
                    const {id, title, price, img,inCart, info} = value.detail
                }}
            </ProductConsumer>
        )
    }
}
